import React from "react";
import { Link } from "react-router-dom";
import "./navbar.css";
import { useState } from "react";
import LogIn from "./loginPage";
import SignUp from "./signupPage";
import Home from "./home";
import Profile from "./profile";
import { Nav, NavLink, NavMenu, NavBtn, NavBtnLink } from "./NavbarElements";

const Navbar = () => {
  // const [openPopup, isOpen] = useState(false);
  return (
    <div>
      <Nav>
        <NavMenu>
          <NavLink to="/home" activeStyle>
            <img src="eventlylogo.svg" alt="homepage logo" />
          </NavLink>
          <NavLink tp="/home" activeStyle>
            Evently
          </NavLink>
          <NavLink to="/loginPage" activeStyle>
            Log In
          </NavLink>
          <NavLink to="/signupPage" activeStyle>
            Sign Up
          </NavLink>
          <NavLink to="/profile" activeStyle>
            <img src="profilelogo.svg" alt="profile logo" />
          </NavLink>
        </NavMenu>
      </Nav>
    </div>
  );
};
export default Navbar;
